import React from 'react';

const StoreDetails = () => {
  return (
    <div className="max-w-7xl mx-auto py-8 px-4">
      <h1 className="text-3xl font-bold text-gray-900 mb-8">Store Details</h1>
      <div className="text-center py-12">
        <p className="text-gray-500">Store details and rating functionality will be implemented when connected to backend APIs.</p>
      </div>
    </div>
  );
};

export default StoreDetails;
